document.addEventListener("DOMContentLoaded",()=>{let a=document.querySelectorAll(".tpgb-mouse-parallax");a&&a.forEach(function(a){a.addEventListener("mouseleave",function(a){let b=a.currentTarget.querySelector(".tpgb-parallax-move");TweenLite.to(b,.9,{x:0,y:0})}),a.addEventListener("mousemove",function(a){let b=a.currentTarget.querySelector(".tpgb-parallax-move");var c=b.dataset.speedx,d=b.dataset.speedy;TweenLite.to(b,.5,{x:-((a.clientX-window.innerWidth/2)/c),y:-((a.clientY-window.innerHeight/2)/d)})})})});